import './App.css';
import Leftbar from './components/Leftbar';
import Cover from "./components/Cover";
import { Container, Row } from "react-bootstrap";
import "./style.css";

function App() {
  return (
    <div className="App">
      <div style={{top: "0", bottom: "0", left: "0", }}>
      <Container fluid>
      <Row>
      <Leftbar />
      <Cover />
      </Row>
      </Container>
      </div>
    </div>
  );
}

export default App;
